import React, { Component } from "react";

class CarInventory extends Component {
  render() {
    return (
      <div className="carInventory">
        <div className="car-container">
          <div className="car-model">
            <div className="carImage">
              <img src="https://photoshop-kopona.com/uploads/posts/2019-04/1554273084_bmw-https://img.pngio.com/car-car-png-260_260.png" />
            </div>
          </div>
          <div className="car-model"></div>
          <div className="car-model"></div>
          <div className="car-model"></div>
          <div className="car-model"></div>
          <div className="car-model"></div>
        </div>
      </div>
    );
  }
}

export default CarInventory;
